const AddInformation = ({imgUrl,name,description,collar, size, weight}) => {
    return(
        <div>
            <div>{imgUrl}</div>
            <div>{name}</div>
            <div>{description}</div>
            <div>{collar}</div>
            <div>{size}</div>
            <div>{weight}</div>
        </div>
    )
}

export default AddInformation
